import React from "react";
import "./css/MeetStaff.css";

const MeetStaff = () => {
  return (
    <div className="meet__staff">
      <div className="staff__container">
        <div className="staff__header">
          <p>Meet our staff</p>
        </div>
      </div>
    </div>
  );
};

export default MeetStaff;
